import React from "react";

const Add = (a, b) => {
  let sum = a + b;
  return sum;
};
const Sub = (a, b) => {
  let sub = a - b;
  return sub;
};
const Mul = (a, b) => {
  let mul = a * b;
  return mul;
};
const Div = (a, b) => {
  let div = a / b;
  return div;
};
export { Add, Sub, Mul, Div };

